import React, {Component} from 'react';

import { BrowserRouter, Link } from "react-router-dom";


class Banner extends Component {
    render(){
        return(
            <div className="banner"  onScroll={ this.handleScroll }>
                <div className="thikdr_banner font-weight-bold banner-photo overflow-hidden" style={{background:`url('/images/banner_photo.png')`,}}>
                    <div className="container">
                        <div className="text_content">
                            <div className="banner_top">
                                <p className="des"><span>&nbsp;</span> Honest</p>
                                <p className="des"><span>&nbsp;</span> Reliable</p>
                                <p className="des"><span>&nbsp;</span> Reliable</p>
                            </div>
                            <h5 className="text-white pb-3 text-uppercase house_contractor">House And Building Construction Contractor</h5>
                            <h3 className="banner_title pb-2 mb-3">Get a house and building contractor expert's call within <span>few minutes.</span></h3>
                            <BrowserRouter>
                                <Link className="book_now" to="#">Book Now</Link>
                            </BrowserRouter>
                        </div>
                        
                    </div>
                </div>
            </div>
        );
    }
}
export default  Banner;
